  'disclaimer.terms': '<li>คุณต้องมีอายุมากกว่า <span class="text-red"><b>18</b></span> ปีขึ้นไป เป็นคนรักสัตว์และเคยมีประสบการณ์กับสัตว์เลี้ยงมาก่อน <hr></li><li>ข้อมูลทั้งหมดที่คุณให้นั้นเป็นความจริงและเป็นของคุณ คุณจะต้องให้หมายเลขโทรศัพท์และอีเมลเพื่อทำการตรวจสอบ เราอาจทำการตรวจสอบประวัติอาชญากรของคุณและมีสิทธิ์ลบบัญชีที่น่าสงสัย <hr></li><li>PetBacker สร้างขึ้นเพื่อทำให้การมีสัตว์เลี้ยงในชีวิตของคุณง่ายขึ้น ค่าธรรมเนียมมาตรฐานของแพลตฟอร์ม ช่วย PetBacker ในการดำเนินงานและพัฒนาอย่างต่อเนื่องเพื่อตอบสนองความต้องการของชุมชนที่กำลังเติบโตของเรา เมื่อเจ้าของสัตว์เลี้ยงจ้างคุณ คุณจะได้รับ <b>75% - 80%</b> หากมีการแลกเปลี่ยนข้อมูลติดต่อและงานไม่ได้ถูกจ้างผ่าน PetBacker คุณจะต้องรับผิดชอบ <b>40%</b>ของราคาเสนอสูงสุดของคุณ หรือ อาจ <b>ถูกต้องสงสัย</b> ถึงแม้ว่าคุณจะยังไม่ได้งานก็ตาม<hr></li><li>คุณยอมรับว่าคุณจะยอมคืนค่าธรรมเนียมทั้งหมดที่ได้รับหรือส่งคืนให้กับลูกค้าในกรณีที่เกิดการตัดสินข้อพิพาทใดๆที่คุณอาจไม่สามารถให้บริการที่เป็นที่น่าพึงพอใจสำหรับลูกค้าได้ <hr></li><li>คุณไม่ใช้พนักงานของ PetBacker แต่อย่างใด แต่เป็นผู้ใช้งานที่ให้บริการในชุมชนคนรักสัตว์ของเรา ในกรณีที่มีเหตุการณ์ฉุกเฉินใดๆ คุณตกลงว่าคุณจะรับผิดชอบเต็มจำนวนสำหรับเหตุการณ์ดังกล่าว ทาง PetBacker จะช่วยคุณลดค่าใช้จ่ายหรือใช้สิทธิ์ <a href="https://www.petbacker.com/premium-insurance-coverage" target="_blank">ประกันคุ้มครอง</a> สำหรับ <span class="text-red">งานที่ชำระเงินแล้ว</span> บนแพลตฟอร์ม <span class="text-red">เท่านั้น</span> </li>',
