  'job.scam.subsequent.booking.outside': '9. การทำการจองซ้ำหรือการจองเพิ่มเติมที่ไม่ได้ทำผ่านแพลตฟอร์ม',
  'job.scam.misleading.customers': '10. สร้างความเข้าใจผิดว่า PetBacker คิดค่าธรรมเนียมโดยไม่แจ้งให้ผู้ใช้บริการทราบเกี่ยวกับการประกันภัย ความปลอดภัยของสัตว์เลี้ยง รวมถึงคุณภาพการให้บริการ',
